const CvLanguages = () => {
  return (
    <div>
      <h2>Languages</h2>
      <ul>
        <li>Polish - C1</li>
        <li>Belarusian - C2</li>
        <li>English - B2</li>
        <li>Russian - C2</li>
      </ul>
    </div>
  );
};

export default CvLanguages;
